export const MainPage = () => {
    return(
        <div className="mainPage" style={{display: "flex", flexWrap: 'wrap'}}>
            <MainSec/>
            <CategorySec/>
            <AdvantagesSec/>
            <RestaurantSec/>
            <MobileSec/>
        </div>
    );
};
